import React, { useState } from 'react';
import './Reg.css';

function Reg() {
  const [email, setEmail] = useState('');
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [mobileNum, setMobileNum] = useState('');
  const [password, setPassword] = useState('');
  const [dateOfBirth, setDateOfBirth] = useState({ month: '', day: '', year: '' });

  const handleRegister = (e) => {
    e.preventDefault();
    if (!email || !firstName || !lastName || !mobileNum || !password || !dateOfBirth.day || !dateOfBirth.month || !dateOfBirth.year) {
      alert('Please fill in all fields');
      return;
    }

    // Registration logic here
    // Assign the employee role automatically

    // Simulating email verification and redirection
    alert('Registration successful! Please check your email for verification.');
    window.location.href = '/login';
  };

  const handleDateChange = (e) => {
    const { name, value } = e.target;
    setDateOfBirth({ ...dateOfBirth, [name]: value });
  };

  return (
    <div className='bg'>
      <div className='wrapper'>
        <h1>Register</h1>
        <form onSubmit={handleRegister}>
          <div className="input-box">
            <label>Email Address</label>
            <input
              type="email"
              placeholder="Email Address"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
          </div>
          <div className="input-row">
            <div className="input-box">
              <label>First Name</label>
              <input
                type="text"
                placeholder="First Name"
                value={firstName}
                onChange={(e) => setFirstName(e.target.value)}
                required
              />
            </div>
            <div className="input-box">
              <label>Last Name</label>
              <input
                type="text"
                placeholder="Last Name"
                value={lastName}
                onChange={(e) => setLastName(e.target.value)}
                required
              />
            </div>
          </div>
          <div className="input-box">
            <label>Mobile Number</label>
            <input
              type="text"
              placeholder="Mobile Number"
              value={mobileNum}
              onChange={(e) => setMobileNum(e.target.value)}
              required
            />
          </div>
          <div className="input-box">
            <label>Password</label>
            <input
              type="password"
              placeholder="Password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
          </div>
          <div className="input-row">
            <div className="input-box">
              <label>Date of Birth</label>
              <div className="dob">
                <select name="month" value={dateOfBirth.month} onChange={handleDateChange} required>
                  <option value="">Month</option>
                  <option value="01">January</option>
                  <option value="02">February</option>
                  <option value="03">March</option>
                  {/* Add remaining months */}
                </select>
                <select name="day" value={dateOfBirth.day} onChange={handleDateChange} required>
                  <option value="">Day</option>
                  {Array.from({ length: 31 }, (_, i) => (
                    <option key={i + 1} value={String(i + 1).padStart(2, '0')}>{i + 1}</option>
                  ))}
                </select>
                <select name="year" value={dateOfBirth.year} onChange={handleDateChange} required>
                  <option value="">Year</option>
                  {Array.from({ length: 100 }, (_, i) => (
                    <option key={2024 - i} value={2024 - i}>{2024 - i}</option>
                  ))}
                </select>
              </div>
            </div>
          </div>
          <button type="submit" className="animated-button">Register</button>
          <div className="login-link">
            <p>Already have an account? <a href="/login">Login</a></p>
          </div>
        </form>
      </div>
    </div>
  );
}

export default Reg;
